import React from "react";
import { BrowserRouter as Router, Route, NavLink } from "react-router-dom";

import { About, Contact, Header, Portfolio, Work } from "../components";

const Homepage = () => {
    return (
        <Router>
            <div>
                <Header />
                <About />
                <Portfolio />
                <Work />
                <Contact />
            </div>
        </Router>
    );
};

export default Homepage;
